    			if (cache.TempProp.isFrozen === true) {
    				this.offsetTop = this.currentRule.displayPosition.offsetTop;
    				this.userViewTop = headItemRows.getModelByAlias(cache.UserView.rowAlias).get('top');
    			} else {
    				this.offsetTop = 0;
    				this.userViewTop = 0;
    			}
