    		getScrollbarWidth: function() {
    			var virtualEl,
    				scrollNone,
    				scrollExist;
    			virtualEl = $('<div/>').css({
    				'width': 50,
    				'height': 50,
    				'overflow': 'hidden',
    				'position': 'absolute',
    				'top': -200,
    				'left': -200
    			}).html('<div style="height:1000px;">');
    			this.$el.append(virtualEl);
    			scrollNone = getWidth();
    			virtualEl.css('overflow-y', 'auto');
    			scrollExist = getWidth();
    			$(virtualEl).remove();
    
    			function getWidth() {
    				return parseInt($('div', virtualEl).innerWidth(), 0);
    			}
    			return (scrollNone - scrollExist);
    		},
